import { urlHead } from "./extrapropertise";

export const fetchHelper = async ({ endpoint, method, data }) => {
    console.log(endpoint);
    var result = fetch(`http://localhost:3000/users/`, {
        method: method,
        headers: {
            'Content-Type': 'application/json'
        },
        body: data,
        mode: 'cors',
    })
    return result;
}
